import React, {Component} from "react";
import {robots} from './robots';
import CardList from './CardList';
import SearchBox from './SearchBox';
class App extends Component{
    render(){
        return (
            <div>
                <h1 style={{}}>RoboFriends</h1>
                <SearchBox />
                <CardList robots={robots}/>
            </div>
        );
    }
}
export default App;
